INSERT INTO necs_goods VALUES('397','115','0','ECS000397','金士顿（Kingston）DDR3 2G-1600 台式机内存','+','878','24','','995','0.000','0.00','122.00','0.00','0','0','1','金士顿4G 内存条 4G内存 金士顿 KST4GDDR31333 金士顿（Kingston） 4GB DDR3 1333 2GB 1600','','<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\">&nbsp;</div>\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g8/M00/12/07/rBEHaFDs3A0IAAAAAAAiWhFWXC8AADkBwKV33UAACJy807.jpg\" /></div>\r\n<div class=\"formwork_titleleft\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; font-weight: 700; padding-top: 0px\">品牌和品质</div>\r\n<div class=\"formwork_text\" style=\"padding-bottom: 0px; text-indent: 2em; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; padding-top: 0px\">金士顿（Kingston）成立于1987年，是全球存储产品的领导品牌，运营体系遍布全球五大洲。作为全球第一大独立内存模组制造商，金士顿以提供品质出众的内存产品而驰名。金士顿致力于使用最高品质的组件并在每个生产阶段进行严谨的测试，确保产品的可靠性、统一性和兼容性。金士顿屡获雇主、产品、服务和创新类的奖项和赞誉，金士顿产品的可靠品质已经得到全球公认！</div>\r\n<div class=\"formwork_titleleft\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; font-weight: 700; padding-top: 0px\">您将得到的产品和服务</div>\r\n<div class=\"formwork_text\" style=\"padding-bottom: 0px; text-indent: 2em; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; padding-top: 0px\">可靠性是金士顿产品策略的基石，我们一直致力于在每项新开发上超越行业标准，并且致力于开发新一代的存储技术，提供您想要和需要的产品。★体现最新内存技术的金士顿内存条；★拥有优秀品质和可靠性能；★享有Kingston ValueRAM系列内存的极高性价比；★本产品享有终身保固，您将享受免费技术支持和金士顿一贯坚持的可靠性保障服务。</div>\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g14/M03/06/19/rBEhVlHtb6IIAAAAAAFLqyeDHJ4AABU9QHOX1cAAUvD249.jpg\" /></div>\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g14/M03/06/19/rBEhVlHtb6wIAAAAAAG2tKEvvH8AABU9QHiJagAAbbM286.jpg\" /></div>\r\n<div class=\"formwork_text\" style=\"padding-bottom: 0px; text-indent: 2em; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; padding-top: 0px\">顶极品牌的金士顿，也拥有面向大众用户的高性价比产品KVR（Kingston ValueRAM）系列。由于在原料采购、产品设计和质量检测方面的优势，ValueRAM系列在制造和质量控制方面都保持着Kingston的一贯高水准，充分保障系统的长期稳定工作。此外，KVR产品还享受金士顿二十年坚持不变的终身保固售后服务，产品使用过程中任何问题都能得到厂商的免费技术支持。</div>\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g9/M03/12/07/rBEHaVDs3m4IAAAAAADQW78V6vgAADkCgFnfkUAANBz053.jpg\" /></div>\r\n<div class=\"formwork_text\" style=\"padding-bottom: 0px; text-indent: 2em; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; padding-top: 0px\">金士顿 KVR 系列内存面向大众消费者，旨在提供极具性价比的产品，为您升级系统提供最实惠的选择。虽然是面对大众用户的产品系列，KVR内存依然保持了金士顿一贯的严谨工艺和可靠品质。金士顿从细节入手，严格测试DRAM和其他的材料成分。经过一系列的信号品质测试、软件压力测试、热测试、特殊系统和长期稳定度测试的重重考验，全面兼容各大主流品牌的<span id=\"wiki-keyword-0\" class=\"wiki-words\" data-id=\"1965\" style=\"border-bottom: 1px dotted; padding-bottom: 2px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\">主板</span>，能为您提供愉快的使用体验。</div>\r\n<p>\r\n<table border=\"0\" cellspacing=\"6\" cellpadding=\"0\" width=\"750\" align=\"center\" style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 12px/18px Arial, Verdana, 宋体; white-space: normal; orphans: 2; empty-cells: show; letter-spacing: normal; color: rgb(102,102,102); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <p class=\"formwork_titleleft\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; font-weight: 700; padding-top: 0px\">1.5V工作电压，发热更低，功耗更小</p>\r\n            <p class=\"formwork_titleleft2\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; padding-top: 0px\">由于Intel在i7及之后的处理器中集成了内存控制器，因此对 DDR3内存的电压提出了要求&mdash;&mdash;内存电压高于1.65V可能会导致CPU损坏。本品在保证高频率高性能的同时，成功地将工作电压限制在 1.5V，可使DDR3内存的功耗减少30%左右。功耗的降低会直接导致内存发热的减少，从而增强长时间使用情况下的寿命和稳定性，并且减少机箱内部的发热还可以减少整个系统所需的散热措施，进而降低风扇等部件的噪音和振动。</p>\r\n            </td>\r\n            <td><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g7/M03/12/07/rBEHZlDs3oIIAAAAAAAf7St_A_cAADkCgIdwLsAACAF619.jpg\" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g8/M02/12/07/rBEHZ1Ds3qYIAAAAAABYfI4T9OEAADkCgNMO1sAAFiU340.jpg\" /></div>\r\n<div class=\"formwork_text\" style=\"padding-bottom: 0px; text-indent: 2em; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; padding-top: 0px\">性能方面，相对于DDR2内存的4bit预取机制，DDR3内存模组最大的改进就是采用了8bit预取机制设计，也就是内部同时并发8位数据。在相同频率下，DDR3 的数据传输率是DDR2的两倍，性能表现也更为出色。此外，DDR3内存还增加了点对点的拓朴架构和异步重置（Reset）与ZQ校准等全新功能。</div>\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g7/M02/12/07/rBEHZVDs3scIAAAAAADWVcWXfeMAADkCwAQbz4AANZt678.jpg\" /></div>\r\n<p>\r\n<table border=\"0\" cellspacing=\"6\" cellpadding=\"0\" width=\"750\" align=\"center\" style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 12px/18px Arial, Verdana, 宋体; white-space: normal; orphans: 2; empty-cells: show; letter-spacing: normal; color: rgb(102,102,102); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n    <tbody>\r\n        <tr>\r\n            <td><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g7/M02/12/07/rBEHZVDs3tYIAAAAAABPRUiMWwgAADkCwEK3agAAE9d486.jpg\" /></td>\r\n            <td>\r\n            <p class=\"formwork_titleleft\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; font-weight: 700; padding-top: 0px\">精心打造高稳定性</p>\r\n            <p class=\"formwork_titleleft2\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; padding-top: 0px\">金士顿 KVR 内存产品皆使用原厂颗粒，通过严格的测试和筛选试验。针对市场主流系统平台做长时间的连续烧机测试及高低温度耐受度测试，100%多级测试使其具有优秀的高稳定性和高效能，让您以更节省的预算享受到安心的质量，满足高标准需求。</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"6\" cellpadding=\"0\" width=\"750\" align=\"center\" style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 12px/18px Arial, Verdana, 宋体; white-space: normal; orphans: 2; empty-cells: show; letter-spacing: normal; color: rgb(102,102,102); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <p class=\"formwork_titleleft\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; font-weight: 700; padding-top: 0px\">完美兼容 安心使用</p>\r\n            <p class=\"formwork_titleleft2\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; padding-top: 0px\">金士顿 KVR 内存卓越稳定度兼容于Intel及AMD平台，经过各大知名品牌主机板的兼容测试，兼容性强、稳定性高。它在各种平台上都能提供给您优越的内存质量，以及系统长时间运作所需的稳定性。</p>\r\n            </td>\r\n            <td><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g9/M00/12/07/rBEHalDs3uwIAAAAAAA78O4ZkmQAADkCwHB5DkAADwI521.jpg\" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g15/M00/00/19/rBEhWVHtb8UIAAAAAAHFfjnQQXQAABSnAIReVkAAcWW266.jpg\" /></div>\r\n<div class=\"formwork_text\" style=\"padding-bottom: 0px; text-indent: 2em; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; padding-top: 0px\">KVR系列的最突出特点就是其性价比，因为产量的因素，金士顿能够充分控制系列产品的成本，使其以极具性价比的价格出现在市场上。作为全球零售销量巨大的内存品种，KVR带给消费者的好处是显而易见的：一是用户众多，与KVR的兼容性是各大主板厂商QC必检的一项环节，因而它与各品牌主板兼容性都一流；二是购买方便，消费者可以在任意卖场轻松找到合适的代理商；三是KVR的售后服务也非常方便，消费者不用担心返厂以后遥遥无期的等待&hellip;&hellip;</div>\r\n<p>\r\n<table border=\"0\" cellspacing=\"6\" cellpadding=\"0\" width=\"750\" align=\"center\" style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 12px/18px Arial, Verdana, 宋体; white-space: normal; orphans: 2; empty-cells: show; letter-spacing: normal; color: rgb(102,102,102); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <p class=\"formwork_titleleft\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; font-weight: 700; padding-top: 0px\">符合JEDEC 规范</p>\r\n            <p class=\"formwork_titleleft2\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; padding-top: 0px\">KVR 内存依据 JEDEC 规范生产。JEDEC 制定了半导体工程的标准，是电子工业协会 (EIA) 的半导体标准化组织。约 300 家代表该行业各个领域的公司积极参与到制定满足行业需求的标准中。金士顿科技公司作为 JEDEC 理事会的长期成员，参与制定了内存技术的行业标准。所有的金士顿内存都完全符合 JEDEC 规范，这是一项应用于半导体领先制造商的重要质量指标。</p>\r\n            </td>\r\n            <td><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g9/M02/12/07/rBEHalDs4FgIAAAAAAAf3EVDRyEAADkDQCWIlIAAB_0752.jpg\" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g9/M02/12/07/rBEHalDs4HYIAAAAAAAthp6qgnEAADkDQKBHlMAAC2e634.jpg\" /></div>\r\n<div class=\"formwork_text\" style=\"padding-bottom: 0px; text-indent: 2em; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; padding-top: 0px\">KVR系列内存产品，生产过程均依据 JEDEC 规范，经过严苛的品质监管，确保每条 KVR 系列内存产品，都能满足使用者对于稳定性与效能上的要求。KVR 所使用的高质量内存颗粒，每一颗均经过金士顿严密筛选，每条内存也都通过 100% 严格验证，以及与各大知名品牌主机板的兼容测试。兼容性强、稳定性高、以及优异的效能表现，并且同时兼顾质量与价格，让您以更节省的预算享受到安心的质量。</div>\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g9/M02/12/07/rBEHalDs4J0IAAAAAADHobYYwtwAADkDgEYK_IAAMe5166.jpg\" /></div>\r\n<p>\r\n<table border=\"0\" cellspacing=\"6\" cellpadding=\"0\" width=\"750\" align=\"center\" style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 12px/18px Arial, Verdana, 宋体; white-space: normal; orphans: 2; empty-cells: show; letter-spacing: normal; color: rgb(102,102,102); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n    <tbody>\r\n        <tr>\r\n            <td><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g8/M00/12/07/rBEHaFDs4KEIAAAAAAA_Vexob-8AADkDQL38LQAAD9t732.jpg\" /></td>\r\n            <td>\r\n            <p class=\"formwork_titleleft\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; font-weight: 700; padding-top: 0px\">精选优质元件，从源头开始把关</p>\r\n            <p class=\"formwork_titleleft2\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; padding-top: 0px\">金士顿在制造内存之前，会精选内存模组中品质最高的DRAM芯片。由于金士顿在半导体存储业界拥有无可比拟的影响力，因此在原材料的采购方面也有着丰富的选择和强大的话语权，能够优先获得最高品质的存储芯片。</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"6\" cellpadding=\"0\" width=\"750\" align=\"center\" style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 12px/18px A