(102,102,102); overflow: hidden; word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">&nbsp;</div>\r\n<div class=\"formwork\" style=\"border-bottom: rgb(230,230,230) 1px dashed; text-align: left; padding-bottom: 10px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; font: 14px/23px Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(102,102,102); overflow: hidden; word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g7/M01/12/0D/rBEHZlDvwswIAAAAAAFrGYwLKmEAADmNAP7JJoAAWsx982.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork\" style=\"border-bottom: rgb(230,230,230) 1px dashed; text-align: left; padding-bottom: 10px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; font: 14px/23px Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(102,102,102); overflow: hidden; word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n<div class=\"formwork_text\" style=\"padding-bottom: 0px; text-indent: 2em; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; padding-top: 0px\">顶极品牌的金士顿，也拥有面向大众用户的高性价比产品KVR（Kingston ValueRAM）系列。由于在原料采购、产品设计和质量检测方面的优势，ValueRAM系列在制造和质量控制方面都保持着Kingston的一贯高水准，充分保障系统的长期稳定工作。</div>\r\n</div>\r\n<div class=\"formwork\" style=\"border-bottom: rgb(230,230,230) 1px dashed; text-align: left; padding-bottom: 10px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; font: 14px/23px Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(102,102,102); overflow: hidden; word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n<div class=\"formwork_text\" style=\"padding-bottom: 0px; text-indent: 2em; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; padding-top: 0px\">KVR产品同样享受金士顿的终身保固售后服务，产品使用过程中任何问题都能得到厂商的免费技术支持。正因为具备了行业领袖的实力，金士顿&ldquo;终身保固&rdquo;的承诺才能二十年不变坚持至今。</div>\r\n</div>\r\n<div class=\"formwork_bt\" style=\"text-align: left; padding-bottom: 10px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; font: 14px/23px Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(102,102,102); overflow: hidden; word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">&nbsp;</div>\r\n<div class=\"formwork\" style=\"border-bottom: rgb(230,230,230) 1px dashed; text-align: left; padding-bottom: 10px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; font: 14px/23px Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(102,102,102); overflow: hidden; word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g9/M02/12/0D/rBEHalDvwxQIAAAAAAGqwlnx-1EAADmNQN0PeIAAara937.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork\" style=\"border-bottom: rgb(230,230,230) 1px dashed; text-align: left; padding-bottom: 10px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; font: 14px/23px Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(102,102,102); overflow: hidden; word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n<div class=\"formwork_text\" style=\"padding-bottom: 0px; text-indent: 2em; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; padding-top: 0px\">KVR系列的最突出特点就是其性价比，因为产量的因素，金士顿能够充分控制系列产品的成本，使其以极具性价比的价格出现在市场上。作为全球零售销量巨大的内存品种，KVR带给消费者的好处是显而易见的：一是用户众多，与KVR的兼容性是各大<span id=\"wiki-keyword-0\" class=\"wiki-words\" data-id=\"1965\" style=\"border-bottom: 1px dotted; padding-bottom: 2px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\">主板</span>厂商QC必检的一项环节，因而它与各品牌主板兼容性都一流；二是购买方便，消费者可以在任意卖场轻松找到合适的代理商；三是KVR的售后服务也非常方便，消费者不用担心返厂以后遥遥无期的等待&hellip;&hellip;</div>\r\n</div>\r\n<p>\r\n<table border=\"0\" cellspacing=\"6\" cellpadding=\"0\" width=\"750\" align=\"center\" style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 12px/18px Arial, Verdana, 宋体; white-space: normal; orphans: 2; empty-cells: show; letter-spacing: normal; color: rgb(102,102,102); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n    <tbody>\r\n        <tr>\r\n            <td><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g9/M00/12/06/rBEHalDr1_0IAAAAAAAf3EVDRyEAADjoAP_b2IAAB_0562.jpg\" /></td>\r\n            <td>\r\n            <p class=\"formwork_titleleft\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; font-weight: 700; padding-top: 0px\">JEDEC 规范</p>\r\n            <p class=\"formwork_titleleft2\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; padding-top: 0px\">JEDEC 制定了半导体工程的标准，是电子工业协会 (EIA) 的半导体标准化组织。约 300 家代表该行业各个领域的公司积极参与到制定满足行业需求的标准中。金士顿科技公司作为 JEDEC 理事会的长期成员，参与制定了内存技术的行业标准。所有的金士顿内存都完全符合 JEDEC 规范，这是一项应用于半导体领先制造商的重要质量指标。</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"6\" cellpadding=\"0\" width=\"750\" align=\"center\" style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 12px/18px Arial, Verdana, 宋体; white-space: normal; orphans: 2; empty-cells: show; letter-spacing: normal; color: rgb(102,102,102); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <p class=\"formwork_titleleft\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; font-weight: 700; padding-top: 0px\">严苛品质，国际标准</p>\r\n            <p class=\"formwork_titleleft2\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; padding-top: 0px\">KVR系列内存产品，生产过程均依据 JEDEC 规范，经过严苛的品质监管，确保每条 KVR 系列内存产品，都能满足使用者对于稳定性与效能上的要求。KVR 所使用的高质量内存颗粒，每一颗均经过金士顿严密筛选，每条内存也都通过 100% 严格验证，以及与各大知名品牌主机板的兼容测试。兼容性强、稳定性高、以及优异的效能表现，并且同时兼顾质量与价格，让您以更节省的预算享受到安心的质量。</p>\r\n            </td>\r\n            <td><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g8/M01/12/06/rBEHaFDr2BgIAAAAAABN-xvDLekAADjoQHTFAIAAE4T958.jpg\" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n<div class=\"formwork\" style=\"border-bottom: rgb(230,230,230) 1px dashed; text-align: left; padding-bottom: 10px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; font: 14px/23px Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(102,102,102); overflow: hidden; word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g6/M00/06/0D/rBEGF1Dr2EcIAAAAAADHobYYwtwAABQQgA2SLsAAMe5235.jpg\" /></div>\r\n</div>\r\n<p>\r\n<table border=\"0\" cellspacing=\"6\" cellpadding=\"0\" width=\"750\" align=\"center\" style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 12px/18px Arial, Verdana, 宋体; white-space: normal; orphans: 2; empty-cells: show; letter-spacing: normal; color: rgb(102,102,102); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n    <tbody>\r\n        <tr>\r\n            <td><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g7/M02/12/06/rBEHZVDr2GcIAAAAAAA-T1jWMZAAADjoQKY9bUAAD5n682.jpg\" /></td>\r\n            <td>\r\n            <p class=\"formwork_titleleft\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; font-weight: 700; padding-top: 0px\">精选优质元件，从源头开始把关</p>\r\n            <p class=\"formwork_titleleft2\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; padding-top: 0px\">金士顿在制造内存之前，会精选内存模组中品质最高的DRAM芯片。由于金士顿在半导体存储业界拥有无可比拟的影响力，因此在原材料的采购方面也有着丰富的选择和强大的话语权，能够优先获得最高品质的存储芯片。</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"6\" cellpadding=\"0\" width=\"750\" align=\"center\" style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 12px/18px Arial, Verdana, 宋体; white-space: normal; orphans: 2; empty-cells: show; letter-spacing: normal; color: rgb(102,102,102); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <p class=\"formwork_titleleft\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; font-weight: 700; padding-top: 0px\">严苛而全面的检测，确保100%稳定</p>\r\n            <p class=\"formwork_titleleft2\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; padding-top: 0px\">金士顿是全球极少数严格要求原料品质，并在所有生产阶段测试模组的制造商之一。金士顿的测试流程包括设计和工程验证测试、AVL 组件品质鉴定、DRAM 品质鉴定规格测试、组件品质鉴定流程、环境压力测试、兼容性测试、可靠性测试、100%生产测试、品质保证和可靠性监测等，这一套全面的检测体系成就了金士顿二十多年来值得信赖的产品可靠性和兼容性。（更详细的检测体系介绍请参考金士顿官方网站：http://www.kingston.com/cn/company/testing）</p>\r\n            </td>\r\n            <td><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g9/M02/12/06/rBEHalDr2IYIAAAAAAB-I7LSJzIAADjoQGrCVQAAH47559.jpg\" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"6\" cellpadding=\"0\" width=\"750\" align=\"center\" style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 12px/18px Arial, Verdana, 宋体; white-space: normal; orphans: 2; empty-cells: show; letter-spacing: normal; color: rgb(102,102,102); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n    <tbody>\r\n        <tr>\r\n            <td><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g9/M02/12/06/rBEHaVDr2JwIAAAAAABAeZYNt3EAADjoQOfU8AAAECR921.jpg\" /></td>\r\n            <td>\r\n            <p class=\"formwork_titleleft\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; font-weight: 700; padding-top: 0px\">美国先进认证实验室</p>\r\n            <p class=\"formwork_titleleft2\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; padding-top: 0px\">美国先进认证实验室（Advanced Validation Labs，AVL）是测试、认证前制与后制内存产品的专业机构，为全球主要代工厂和主板制造厂商提供测试与认证相关的技术性服务。金士顿已发展出在产业中最先进的测试设备。金士顿使用多层次的测试系统以确保并控制从设计到制造过程中的产品品质，这个完全的测试程序已经成为十几年来客户对金士顿产品可靠度和兼容性的指标。</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n<div class=\"formwork_bt\" style=\"text-align: left; padding-bottom: 10px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; font: 14px/23px Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(102,102,102); overflow: hidden; word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">&nbsp;</div>\r\n<div class=\"formwork\" style=\"border-bottom: rgb(230,230,230) 1px dashed; text-align: left; padding-bottom: 10px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; font: 14px/23px Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(102,102,102); overflow: hidden; word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g9/M02/12/06/rBEHalDr2RYIAAAAAAB2CeFPxHMAADjogIYus4AAHYh369.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork\" style=\"border-bottom: rgb(230,230,230) 1px dashed; text-align: left; padding-bottom: 10px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; font: 14px/23px Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(102,102,102); overflow: hidden; word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n<div class=\"formwork_text\" style=\"padding-bottom: 0px; text-indent: 2em; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; padding-top: 0px\">相对于DDR2内存的4bit预取机制，DDR3内存模组最大的改进就是采用了8bit预取机制设计，也就是内部同时并发8位数据。在相同频率下，DDR3 的数据传输率是DDR2的两倍，性能表现也更为出色。此外，DDR3内存还增加了点对点的拓朴架构和异步重置（Reset）与ZQ校准等全新功能。</div>\r\n</div>\r\n<div class=\"formwork\" style=\"border-bottom: rgb(230,230,230) 1px dashed; text-align: left; padding-bottom: 10px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; font: 14px/23px Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(102,102,102); overflow: hidden; word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n<div class=\"formwork_text\" style=\"padding-bottom: 0px; text-indent: 2em; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; padding-top: 0px\">而与标准的 1333MHz 内存相比，1600MHz 工作频率的 KVR DDR3 内存将内存带宽直接增加了20%，更大的内存带宽意味着 CPU 与内存之间的数据交换会更加快速，进而提升系统的整体性能和流畅度。</div>\r\n</div>\r\n<p>\r\n<table border=\"0\" cellspacing=\"6\" cellpadding=\"0\" width=\"750\" align=\"center\" style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 12px/18px Arial, Verdana, 宋体; white-space: normal; orphans: 2; empty-cells: show; letter-spacing: normal; color: rgb(102,102,102); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <p class=\"formwork_titleleft\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; font-weight: 700; padding-top: 0px\">符合Intel低电压标准</p>\r\n            <p class=\"formwork_titleleft2\" style=\"padding-bottom: 0px; line-height: 25px; margin: 0px; padding-left: 0px; padding-right: 0px; font-size: 14px; padding-top: 0px\">由于Intel在i7及之后的处理器中集成了内存控制器，因此对 DDR3内存的电压提出了要求&mdash;&mdash;内存电压高于1.65V可能会导致CPU损坏。本品在保证高频率高性能的同时，成功地将工作电压限制在 1.5V，可使DDR3内存的功耗减少30%左右，同时I/O缓冲的电压和驱动阻抗也降低了。功耗的降低会直接导致内存发热的减少，从而增强长时间使用情况下的寿命和稳定性，并且减少机箱内部的发热还可以减少整个系统所需的散热措施，进而降低风扇等部件的噪音和振动。此外，增强长时间使用情况下的寿命和稳定性也为您保留了进一步超频至更高频率的能力。</p>\r\n            </td>\r\n            <td><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g6/M01/06/0D/rBEGC1Dr2VEIAAAAAAAf7St_A_cAABQQwK8tdwAACAF777.jpg\" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n<div class=\"formwork\" style=\"border-bottom: rgb(230,230,230) 1px dashed; text-align: left; padding-bottom: 10px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 753px; padding-right: 0px; font: 14px/23px Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(102,102,102); overflow: hidden; word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n<div class=\"formwork_img\" style=\"text-align: center; padding-bottom: 0px; margin: 0px auto; padding-left: 0px; width: 750px; padding-right: 0px; padding-top: 0px\"><img class=\"err-product\" alt=\"\" style=\"background-image: url(http://misc.360buyimg.com/lib/skin/e/i/error-jd.gif); padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; background-position: 50% 50%; vertical-align: middle; padding-top: 0px\" src=\"http://img20.360buyimg.com/vc/g8/M03/12/