; list-style-type: none; text-align: left\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">&nbsp;</span></p>\r\n<p style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 1.12em 0px; padding-top: 0px; list-style-type: none\">&nbsp;</p>\r\n<p style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 1.12em 0px; padding-top: 0px; list-style-type: none; text-align: left\">&nbsp;</p>\r\n<h3 style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 1em 0px; padding-top: 0px\">产品规格</h3>\r\n<p style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 1.12em 0px; padding-top: 0px; list-style-type: none\">&nbsp;</p>\r\n<p style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 1.12em 0px; padding-top: 0px; list-style-type: none; text-align: left\">&nbsp;</p>\r\n<table cellspacing=\"0\" cellpadding=\"0\" style=\"font-size: 14px; color: rgb(64,64,64); line-height: 21px; border-collapse: collapse; border-spacing: 0px\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">中央处理器</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">AMD AM3+ FX&trade;/Phenom&trade; II/Athlon&trade; II/Sempron&trade; 100 Series 处理器<br />\r\n            支持 AM3+ 32 nm CPU<br />\r\n            支持 CPU 可达8 核心<br />\r\n            支持高达140 W处理器<br />\r\n            AMD Cool \'n\' Quiet&trade; 技术</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">芯片组</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">AMD 970/SB950</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">内存</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">4 x DIMM内存插槽, 最大容量 32GB, DDR3 2133(超频)/1866/1600/1333/1066 MHz ECC, Non-ECC, Un-buffered 内存<br />\r\n            双通道内存架构<br />\r\n            * 请访问<a style=\"color: rgb(78,78,78)\">www.asus.com.cn</a>或参考用户手册取得內存合格供应商支持列表（QVL）。<br />\r\n            *当您安装4GB以上内存时，Windows&reg; 32位操作系统可能仅识别为3GB以下。因此，如您使用4GB以上的内存，推荐使用Windows&reg; 64位操作系统。<br />\r\n            * 由于CPU行为限制, AMD 100系列处理器支持DDR3 1066MHz。凭借华硕设计，此主板支持可达DDR3 1333MHz。</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">系统总线</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">高达 4.8 GT/s HyperTransport&trade; 3.0 总线</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">多重图形显示技术</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">支持 AMD&reg; Quad-GPU CrossFireX&trade; 技术</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">扩展槽</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">1 x PCIe 2.0 x16扩展卡插槽 (蓝色)<br />\r\n            1 x PCIe 2.0 x16扩展卡插槽 (x4 模式, 黑色)<br />\r\n            2 x PCIe 2.0 x1扩展卡插槽<br />\r\n            2 x PCI扩展卡插槽</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">存储功能</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><strong>AMD SB950 控制器 :</strong><br />\r\n            6 x SATA 6Gb/s 接口 , 灰色<br />\r\n            支持 Raid 0, 1, 5, 10</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">网络功能</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">Realtek&reg; 8111F 千兆网卡控制器, 1 x 千兆网卡</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">音效</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">Realtek&reg; ALC 887 8 声道 高清晰音频编码解码器*<sup style=\"vertical-align: text-top\">1</sup><br />\r\n            - 支持: 音频接口检测(Jack-detection), 多音源独立输出(Multi-Streaming)技术, 自订前端面板音频插孔功能<br />\r\n            <strong>音频功能:</strong><br />\r\n            - 华硕噪音过滤功能<br />\r\n            - 主板中央具备有光纤S/PDIF数字输出连接端口</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">USB 接口</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><strong>ASMedia&reg; USB 3.0 控制器 :</strong><br />\r\n            2 x USB 3.0/2.0 连接端口 (2 个位于后侧面板, 蓝色)<br />\r\n            <strong>AMD SB950 控制器 :</strong><br />\r\n            12 x USB 2.0/1.1 连接端口 (6 个位于后侧面板, 黑色, 6 个位于主板中央)</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">超频功能</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><strong>超频防护功能:</strong><br />\r\n            - 华硕C.P.R.（CPU参数恢复）</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">独特功能</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><strong>- 华硕TPU智能加速处理器和华硕EPU智能节能处理器双智能处理器</strong><br />\r\n            <strong>华硕TPU智能加速处理器 :</strong><br />\r\n            - 瞬间加速<br />\r\n            - 自动加速<br />\r\n            <strong>华硕EPU智能节能处理器 :</strong><br />\r\n            - EPU<br />\r\n            <strong>华硕供电设计:</strong><br />\r\n            - 4 +2 相供电设计<br />\r\n            <strong>华硕独家功能</strong>:<br />\r\n            - 智能管家2代<br />\r\n            - 华硕充电专家<br />\r\n            - 中文图形化界面的UEFI BIOS（EZ 模式)，具备友善的图像化用户界面。<br />\r\n            - USB 3.0 加速<br />\r\n            - 智能网络管理中心<br />\r\n            <strong>华硕静音散热解决方案</strong>:<br />\r\n            - 华硕无风扇设计: 美学散热片<br />\r\n            - 华硕风扇达人<br />\r\n            <strong>华硕EZ DIY:</strong><br />\r\n            - Precision Tweaker 2<br />\r\n            - 华硕 O.C. Profile<br />\r\n            - 华硕 EZ Flash 2<br />\r\n            - 华硕 MyLogo 2<br />\r\n            - 多国语言BIOS<br />\r\n            <strong>华硕Q-Design:</strong><br />\r\n            - 华硕 Q-Slot</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">背板 I/O 接口</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">1 x PS/2键盘接口(紫色)<br />\r\n            1 x PS/2鼠标接口(绿色)<br />\r\n            1 x LAN (RJ45) 接口<br />\r\n            2 x USB 3.0 接口<br />\r\n            6 x USB 2.0 接口<br />\r\n            3 x 音频插孔</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">内部 I/O 接口</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">3 x USB 2.0 接口 可扩展6组外接式USB 2.0接口<br />\r\n            1 x 串口连接插座（COM）<br />\r\n            6 x SATA 6Gb/s设备连接插座<br />\r\n            1 x 中央处理器风扇电源插槽 (4 -pin)<br />\r\n            3 x 机箱风扇接口 (4 -pin)<br />\r\n            1 x S/PDIF_Out数字音频连接排针<br />\r\n            1 x 24-pin EATX主板电源插槽<br />\r\n            1 x 4-pin ATX 12V主板电源插槽<br />\r\n            1 x 前面板音频接口 (AAFP)<br />\r\n            1 x 系统面板接口<br />\r\n            1 x 机箱入侵检测<br />\r\n            1 x 清除CMOS跳线</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">配件</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px