            防毒软件（OEM版本）</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">尺寸规格</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">ATX 型式<br />\r\n            12 英寸 x 9 英寸 ( 30.5 厘米 x 22.9 厘米 )</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\">备注</span></td>\r\n            <td style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><span style=\"padding-right: 0px; padding-left: 0px; padding-bottom: 0px; margin: 0px; padding-top: 0px\"><sup style=\"vertical-align: text-top\">*</sup>1: 请使用前面板具备 HD 音频插孔的机箱以支持 8 声道音频输出.</span></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table cellspacing=\"0\" cellpadding=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td>&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td>&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td>&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td>&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td>&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td>&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td>&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n     