INSERT INTO necs_goods VALUES('414','167','0','ECS000414','Asus/华硕 M5A99X EVO R2.0八核主板 支持FX 8350 高端 游戏主板','+','536','3','','100','0.000','0.00','946.00','0.00','0','0','10','华硕M5A99XEVOR2.0 华硕大板 A990X大板 AMD AM3＋ 990X ATX（标准型）','','<p>&nbsp;</p>\r\n<p><img id=\"midImg\" alt=\"\" src=\"http://c1.neweggimages.com.cn/neweggpic2/neg/P380/A18-050-3DP_13.jpg\" /><img id=\"midImg\" alt=\"\" src=\"http://c1.neweggimages.com.cn/neweggpic2/neg/P380/A18-050-3DP_12.jpg\" /><img id=\"midImg\" alt=\"\" src=\"http://c1.neweggimages.com.cn/neweggpic2/neg/P380/A18-050-3DP_04.jpg\" /><img id=\"midImg\" alt=\"\" src=\"http://c1.neweggimages.com.cn/neweggpic2/neg/P380/A18-050-3DP.jpg\" /></p>\r\n<p style=\"text-align: center\"><img height=\"369\" alt=\"\" width=\"554\" border=\"0\" src=\"http://c1.neweggimages.com.cn/NeweggPic2/Description/A18-050-3DPd_003.jpg\" /></p>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><strong>M5A99X EVO R2.0<br />\r\n支持Windows 8，在AMD 990X平台上搭载CPU 和 DRAM数字供电设计，以提升系统性能。</strong><br />\r\n● 具备全新的DIGI+数字供电控制的第3代双智能处理器-完全硬件控制，整体性能调校。<br />\r\n● Remote GO! -提供一站式满足 PC 远程控制和家庭娱乐的功能<br />\r\n● USB 3.0 加速 -支持UASP协议、更快的USB 3.0传输速度!<br />\r\n● 网络智能管理（Network iControl）-实时地网络带宽控制<br />\r\n● DirectKey -进入 BIOS 的快捷按钮<br />\r\n● USB BIOS Flashback -基于硬件设计，让BIOS一键更新简单易用。<br />\r\n● 中文图形化界面的UEFI BIOS（EZ 模式) - 灵活&amp;易用的 BIOS 界面<br />\r\n● 支持 Windows 8&mdash;全面硬件支持</div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>\r\n<table cellspacing=\"0\" cellpadding=\"0\" width=\"100%\" border=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td>ASUS 华硕</td>\r\n        </tr>\r\n        <tr>\r\n            <td>M5A99X EVO R2.0</td>\r\n        </tr>\r\n        <tr>\r\n        </tr>\r\n        <tr>\r\n            <td>Socket AM3+</td>\r\n        </tr>\r\n        <tr>\r\n            <td>AMD AM3+ FX/Phenom II/Athlon II/Sempron 100 系列 处理器</td>\r\n        </tr>\r\n        <tr>\r\n            <td>高达 5.2 GT/s HyperTransport 3.0 总线</td>\r\n        </tr>\r\n        <tr>\r\n      