\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">系统总线</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>支持4400 MT/s</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">芯片组</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>北桥: AMD 760G</li>\r\n                <li>南桥: AMD SB710</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">内存</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>2个1.5V DDR3 DIMM插槽，最高支持到8 GB (注一)</li>\r\n                <li>支持双信道内存技术</li>\r\n                <li>支持DDR3 1333+ (O.C.)/1066/800 MHz</li>\r\n            </ol>\r\n            (详细支持列表请参考 &quot;内存支持列表&quot;)</td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">显示功能</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">内建于北桥芯片:<br />\r\n            <ol>\r\n                <li>1个D-Sub插座</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">音效</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>内建Realtek HD音效芯片</li>\r\n                <li>支持High Definition Audio</li>\r\n                <li>支持2/4/5.1/7.1声道 (注二)</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">网络</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>内建Atheros GbE LAN芯片(10/100/1000 Mbit)</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">扩展槽</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>1个PCI Express x16插槽，支持x16运作规格</li>\r\n                <li>1个PCI Express x1插槽 (所有PCI Express插槽皆支持PCI Express 2.0)</li>\r\n                <li>1个PCI插槽</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">储存装置接口</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">内建于南桥芯片:<br />\r\n            <ol>\r\n                <li>6个SATA 3Gb/s插座，可连接6个SATA 3Gb/s装置</li>\r\n                <li>SATA支持RAID 0、RAID 1、RAID 10及JBOD功能</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">USB</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">内建于南桥芯片:<br />\r\n            <ol>\r\n                <li>最多支持8个USB 2.0/1.1端口(4个在后方面板，4个需经由扁平电缆从主板内USB插座接出)</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">内接插座</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>1个24-pin ATX主电源插座</li>\r\n                <li>1个4-pin ATX 12V电源插座</li>\r\n                <li>6个SATA 3Gb/s插座</li>\r\n                <li>1个CPU风扇插座</li>\r\n                <li>1个系统风扇插座</li>\r\n                <li>1个前端控制面板插座</li>\r\n                <li>1个前端音源插座</li>\r\n                <li>2个USB 2.0/1.1插座</li>\r\n                <li>1个清除CMOS数据功能接脚</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">后方面板装置连接插座</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>1个PS/2键盘插座</li>\r\n                <li>1个PS/2鼠标插座</li>\r\n                <li>1个D-Sub插座</li>\r\n                <li>4个USB 2.0/1.1端口</li>\r\n                <li>1个RJ-45埠</li>\r\n                <li>3个音源接头(音源输入/音源输出/麦克风)</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">I/O控制器</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>内建iTE I/O 控制芯片</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">硬件监控</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>系统电压侦测</li>\r\n                <li>CPU/系统温度侦测</li>\r\n                <li>CPU/系统风扇转速侦测</li>\r\n                <li>CPU过温警告</li>\r\n                <li>CPU/系统风扇故障警告</li>\r\n                <li>CPU/系统智能风扇控制 (注三)</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">BIOS</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>1个16 Mbit flash</li>\r\n                <li>使用经授权AWARD BIOS</li>\r\n                <li>PnP 1.0a、DMI 2.0、SM BIOS 2.4、ACPI 1.0b</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">附加工具程序</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>支持@BIOS</li>\r\n                <li>支持Q-Flash</li>\r\n                <li>支持Xpress BIOS Rescue</li>\r\n                <li>支持Download Center</li>\r\n                <li>支持Xpress Install</li>\r\n                <li>支持Xpress Recovery2</li>\r\n                <li>支持EasyTune (注四)</li>\r\n                <li>支持Smart Recovery</li>\r\n                <li>支持Auto Green</li>\r\n                <li>支持ON/OFF Charge</li>\r\n                <li>支持3TB+ Unlock</li>\r\n                <li>支持Q-Share</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">附赠软件</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>Norton Internet Security (OEM版本)</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">操作系统</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>支持Microsoft<sup>&reg;</sup>Windows 7/Vista/XP</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">PCB规格</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">\r\n            <ol>\r\n                <li>Micro ATX规格；24.4公分x 18.8公分</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-bottom: 10px; padding-left: 5px; width: 100px; padding-right: 0px; padding-top: 10px\">批注</td>\r\n            <td style=\"padding-bottom: 10px; padding-left: 10px; padding-right: 10px; padding-top: 10px\">(注一) 由于Windows 32-bit操作系统的限制，若安装超过4 GB的物理内存时，实际上显示之内存容量将少于4 GB。<br />\r\n            <br />\r\n            (注二) 若要启动7.1声道音效输出，必须使用HD (High Definition，高传真)音效模块的前方面板音源输出接出，并透过音效软件选择多声道音效功能。<br />\r\n            <br />\r\n            (注三) 是否支持CPU/系统智能风扇控制功能会依不同的CPU/系统散热风扇而定。<br />\r\n            <br />\r\n            (注四) EasyTune可使用的功能会因不同主板而有所差异。</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>','images/201308/thumb_img/438_thumb_G_1376625823733.jpg','images/201308/goods_img/438_G_1376625823370.jpg','images/201308/source_img/438_G_1376625823484.jpg','1','','1','1','0','0','1361439022','100','0','0','0','0','0','0','1396044763','1','','0','0','0','0');
