INSERT INTO necs_goods VALUES('443','169','0','ECS000443','Gigabyte/技嘉 F2A55M-DS2 FM2接口小板双UEFI BIOS设计，支持Graphics技术，关机充电功能','+','890','4','','41','0.000','0.00','309.00','0.00','0','0','1','技嘉GA-A55M-DS2 技嘉A55小板 AMD FM2 A55 M-ATX(紧凑型)','','<h1>技嘉F2A55M-DS2</h1>\r\n<p>以下实图介绍仅供参考：</p>\r\n<p><img alt=\"\" align=\"absMiddle\" _ks_lazy_width=\"85\" _ks_lazy_height=\"85\" src=\"http://img04.taobaocdn.com/imgextra/i4/163651245/T2wsblXmdXXXXXXXXX_!!163651245.jpg\" /></p>\r\n<p style=\"text-align: center\">技嘉独家3D BIOS技术与双UEFI BIOS专利设计</p>\r\n<p style=\"text-align: center\">技嘉独家「第四代超耐久技术」经典版，高效能高质量用料</p>\r\n<p style=\"text-align: center\">支持Socket FM2 AMD A系列/ Athlon系列处理器</p>\r\n<p style=\"text-align: center\"><img alt=\"\" align=\"absMiddle\" _ks_lazy_width=\"85\" _ks_lazy_height=\"85\" src=\"http://img03.taobaocdn.com/imgextra/i3/163651245/T2FRenXdFcXXXXXXXX_!!163651245.jpg\" /></p>\r\n<p style=\"text-align: center\">搭载Dual-link DVI端口以支持最大至2560 x 1600超高分辨率</p>\r\n<p style=\"text-align: center\">8 USB2.0及4 SATA2搭载RAID 0,1,10磁盘阵列支持</p>\r\n<p style=\"text-align: center\">技嘉独特On/Off Charge技术以支持优化充电效能</p>\r\n<p>&nbsp;</p>\r\n<div style=\"border-right: #aac4e5 1px solid; border-top: #aac4e5 1px solid; font-weight: normal; font-size: 14px; margin: 0px auto; overflow: hidden; border-left: #aac4e5 1px solid; width: 720px; line-height: 26px; border-bottom: #aac4e5 1px solid; font-style: normal; background-color: #aac4e5; font-variant: normal\">\r\n<table cellspacing=\"1\" cellpadding=\"0\" width=\"100%\" style=\"border-right: #aac4e5 2px solid; border-top: #aac4e5 2px solid; font-size: 12px; border-left: #aac4e5 2px solid; color: #333333; border-bottom: #aac4e5 2px solid\">\r\n    <tbody>\r\n        <tr>\r\n            <td bgcolor=\"#ffffff\" colspan=\"2\">\r\n            <table cellspacing=\"0\" cellpadding=\"0\" width=\"100%\" border=\"0\" style=\"border-collapse: collapse\">\r\n                <tbody>\r\n                    <tr style=\"padding-right: 14px; padding-left: 14px; paddi