\">\r\n            <td style=\"width: 80px\"><span>PCI插槽</span></td>\r\n            <td>2&times;PCI插槽</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>SATA接口</span></td>\r\n            <td>6&times;SATA II接口</td>\r\n        </tr>\r\n        <tr style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td colspan=\"2\" style=\"background: #f2f7fd\"><b>I/O接口</b></td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>USB接口</span></td>\r\n            <td>14&times;USB2.0接口（8内置+6背板）</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>HDMI接口</span></td>\r\n            <td>1&times;HDMI接口</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>PS/2接口</span></td>\r\n            <td>PS/2鼠标，PS/2键盘接口</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>并口串口</span></td>\r\n            <td>1个串口</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>其它接口</span></td>\r\n            <td>1&times;RJ45网络接口<br />\r\n            音频接口</td>\r\n        </tr>\r\n        <tr style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td colspan=\"2\" style=\"background: #f2f7fd\"><b>板型</b></td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>主板板型</span></td>\r\n            <td>ATX板型</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>外形尺寸</span></td>\r\n            <td>30.5&times;19.0cm</td>\r\n        </tr>\r\n        <tr style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td colspan=\"2\" style=\"background: #f2f7fd\"><b>软体管理</b></td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>BIOS性能</span></td>\r\n            <td>2个32Mbit flash<br />\r\n            使用经授权AMI EFI BIOS<br />\r\n            支持DualBIOS<br />\r\n            PnP 1.0a、DMI 2.0、SM BIOS 2.6、ACPI 2.0a</td>\r\n        </tr>\r\n        <tr style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td colspan=\"2\" style=\"background: #f2f7fd\"><b>其它参数</b></td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>多显卡技术</span></td>\r\n            <td>支持AMD Dual Graphics技术</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>电源插口</span></td>\r\n            <td>一个8针，一个24针电源接口</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>供电模式</span></td>\r\n            <td>六相</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>RAID功能</span></td>\r\n            <td>支持RAID 0，1，10</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>硬件监控</span></td>\r\n            <td>系统电压侦测<br />\r\n            APU/系统温度侦测<br />\r\n            APU/系统/电源风扇转速侦测<br />\r\n            APU过温警告<br />\r\n            APU/系统/电源风扇故障警告<br />\r\n            APU/系统智能风扇控制</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\"><span>其他特点</span></td>\r\n            <td>支持Microsoft Windows 8/7/Vista/XP操作系统</td>\r\n        </tr>\r\n        <tr style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td colspan=\"2\" style=\"background: #f2f7fd\">&nbsp;</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\">&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\">&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\">&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\">&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\">&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr bgcolor=\"#ffffff\" style=\"padding-right: 5px; padding-left: 5px; padding-bottom: 5px; padding-top: 5px\">\r\n            <td style=\"width: 80px\">&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"right\" bgcolor=\"#ffffff\" colspan=\"2\" height=\"25\">&nbsp;</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>','images/201302/thumb_img/446_thumb_G_1361526508829.jpg','images/201302/goods_img/446_G_1361526508343.jpg','images/201302/source_img/446_G_1361526508697.jpg','1','','1','1','0','0','1361439023','100','0','0','0','0','0','0','1398368603','1','','1','0','0','0');
INSERT INTO necs_goods VALUES('449','168','0','ECS000449','Gigabyte/技嘉 H61-S3 板载千兆网卡1155针大板','+','578','4','','97','0.000','0.00','399.00','0.00','0','0','10','技嘉GA-H61-S3 技嘉H61 INTEL 1155 H61 ATX（标准型）','','<div class=\"content\" id=\"J_DivItemDesc\">\r\n<p><img alt=\"\" align=\"absMiddle\" src=\"http://img02.taobaocdn.com/imgextra/i2/257158574/T2q2jnXghXXXXXXXXX_!!257158574.png\" /><img alt=\"\" align=\"absMiddle\" src=\"http://img01.taobaocdn.com/imgextra/i1/257158574/T2k8SPXeNbXXXXXXXX_!!257158574.png\" /><img alt=\"\" align=\"absMiddle\" src=\"http://img02.taobaocdn.com/imgextra/i2/257158574/T2BuTnXnVXXXXXXXXX_!!257158574.png\" /><img alt=\"\" align=\"absMiddle\" src=\"http://img04.taobaocdn.com/imgextra/i4/257158574/T2y8_mXjNXXXXXXXXX_!!257158574.png\" /><img alt=\"\" align=\"absMiddle\" src=\"http://img01.taobaocdn.com/imgextra/i1/257158574/T26_znXbBXXXXXXXXX_!!257158574.png\" /><img alt=\"\" align=\"absMiddle\" _ks_lazy_width=\"85\" _ks_lazy_height=\"85\" src=\"http://img04.taobaocdn.com/imgextra/i4/257158574/T2MvDnXnhXXXXXXXXX_!!257158574.png\" /><img alt=\"\" align=\"absMiddle\" _ks_lazy_width=\"85\" _ks_lazy_height=\"85\" src=\"http://img04.taobaocdn.com/imgextra/i4/257158574/T2KE6mXadaXXXXXXXX_!!257158574.png\" /><img alt=\"\" align=\"absMiddle\" _ks_lazy_width=\"85\" _ks_lazy_height=\"85\" src=\"http://img03.taobaocdn.com/imgextra/i3/257158574/T2eJ5YXoRaXXXXXXXX_!!257158574.png\" /></p>\r\n</div>','images/201302/thumb_img/449_thumb_G_1361559501629.jpg','images/201302/goods_img/449_G_1361559501600.jpg','images/201302/source_img/449_G_1361559501804.jpg','1','','1','1','0','0','1361439023','100','0','0','0','0','0','0','1399830952','1','','1','0','0','0');
INSERT INTO necs_goods VALUES('450','168','0','ECS000450','Gigabyte/技嘉 H61M-DS2 板载千兆网卡115针全固态小板，图形化双BIOS','+','1007','4','','86','0.000','0.00','305.00','0.00','0','0','10','技嘉GA-H61M-DS2 技嘉H61小板 INTEL 1155 H61 M-ATX(紧凑型)','','<p style=\"text-align: left\"><strong>以下实图介绍仅供参考：</strong></p>\r\n<p style=\"text-align: center\"><img alt=\"\" align=\"absMiddle\" _ks_lazy_height=\"85\" _ks_lazy_width=\"85\" src=\"http://img02.taobaocdn.com/imgextra/i2/163651245/T2L3TiXlVaXXXXXXXX_!!163651245.jpg\" /></p>\r\n<p style=\"text-align: center\">&nbsp;</p>\r\n<p style=\"text-align: center\">技嘉第四代超耐久&trade; 经典版设计</p>\r\n<p style=\"text-align: center\">支持Intel下一代22奈米及LGA1155第二代酷睿&trade;处理器</p>\r\n<p style=\"text-align: center\">支持 PCI-Express 第三代传输接口</p>\r\n<ul>\r\n    <li style=\"text-align: center\"><img alt=\"\" align=\"absMiddle\" _ks_lazy_height=\"85\" _ks_lazy_width=\"85\" src=\"http://img02.taobaocdn.com/imgextra/i2/163651245/T2WNaSXeRbXXXXXXXX_!!163651245.jpg\" /></li>\r\n</ul>\r\n<p style=\"text-align: center\">支持On/Off Charge优化iPad, iPhone and iPod Touch的充电效能</p>\r\n<p style=\"text-align: center\">全固态电容设计</p>\r\n<p style=\"text-align: center\">支持Intel 最新处理器内建绘图核心HD 2000/3000</p>\r\n<p style=\"text-align: center\"><img alt=\"\" align=\"absMiddle\" _ks_lazy_height=\"85\" _ks_lazy_width=\"85\" src=\"http://img03.taobaocdn.com/imgextra/i3/163651245/T2waqFXnxbXXXXXXXX_!!163651245.jpg\" /></p>\r\n<p style=\"text-align: center\">创新Smart6 软硬件技术提供更灵活的计算机管理接口</p>\r\n<p style=\"text-align: center\">Dual UEFI BIOS 搭配Hybrid EFI Technology可支持3TB以上硬盘</p>\r\n<p style=\"text-align: center\">&nbsp;</p>\r\n<p>\r\n<table cellspacing=\"0\" cellpadding=\"0\" align=\"center\" border=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">中央处理器(CPU)</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>支持LGA1155插槽处理器： Intel<sup>&reg;</sup>Core&trade; i7处理器 / Intel<sup>&reg;</sup>Core&trade; i5处理器 / Intel<sup>&reg;</sup>Core&trade; i3处理器 / Intel<sup>&reg;</sup>Pentium<sup>&reg;</sup>处理器 / Intel<sup>&reg;</sup>Celeron<sup>&reg;</sup>处理器</li>\r\n                <li>L3高速缓存取决于CPU</li>\r\n            </ol>\r\n            (部份 Intel<sup>&reg;</sup>Core&trade; 处理器需要搭配外接显卡, 详细支持列表请参考 &quot;CPU 支持列表&quot;)</td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">芯片组</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>Intel<sup>&reg;</sup>H61 高速芯片组</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">内存</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>2个1.5V DDR3 DIMM插槽，最高支持到16 GB<br />\r\n                * 由于Windows 32-bit操作系统的限制，若安装超过4 GB容量内存时，实际上显示之内存容量将少于实际安装的内存容量。 <br />\r\n                &nbsp;</li>\r\n                <li>支持双信道内存技术 <br />\r\n                &nbsp;</li>\r\n                <li>支持DDR3 1333/1066/800 MHz <br />\r\n                &nbsp;</li>\r\n                <li>支持non-ECC内存 <br />\r\n                &nbsp;</li>\r\n                <li>支持Extreme Memory Profile (XMP)内存<br />\r\n                * 支持XMP功能需搭配22nm (Ivy Bridge) CPU。</li>\r\n            </ol>\r\n            (详细支持列表请参考 &quot;内存支持列表&quot;)</td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">显示功能</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">内建于有显示功能的处理器：\r\n            <ol>\r\n                <li>1个D-Sub插座</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">音效</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>内建Realtek ALC887芯片</li>\r\n                <li>支持High Definition Audio</li>\r\n                <li>支持2/4/5.1/7.1声道<br />\r\n                * 若要启动7.1声道音效输出，必须使用HD (High Definition，高传真)音效模块的前方面板音源输出接出，并透过音效软件选择多声道音效功能。</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">网络</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>内建Realtek GbE LAN芯片(10/100/1000 Mbit)</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">扩展槽</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>1个PCI Express x16插槽，支持x16运作规格<br />\r\n                (PCI Express x16插槽支持PCI Express 3.0)<br />\r\n                * 是否支持PCI Express 3.0依所使用的CPU及显示适配器的兼容性而定。 <br />\r\n                &nbsp;</li>\r\n                <li>2个PCI Express x1插槽<br />\r\n                (所有PCI Express x1插槽皆支持PCI Express 2.0)</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">储存装置接口</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">内建于芯片组：\r\n            <ol>\r\n                <li>4个SATA 3Gb/s插座，可连接4个SATA 3Gb/s装置</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">USB</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">内建于芯片组：\r\n            <ol>\r\n                <li>最多支持8个USB 2.0/1.1端口(4个在后方面板，4个需经由扁平电缆从主板内USB插座接出)</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">内接插座</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>1个24-pin ATX主电源插座</li>\r\n                <li>1个4-pin ATX 12V电源插座</li>\r\n                <li>4个SATA 3Gb/s插座</li>\r\n                <li>1个CPU风扇插座</li>\r\n                <li>1个系统风扇插座</li>\r\n                <li>1个前端控制面板插座</li>\r\n                <li>1个前端音源插座</li>\r\n                <li>2个USB 2.0/1.1插座</li>\r\n                <li>1个清除CMOS数据功能接脚</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">后方面板装置连接插座</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>1个PS/2键盘插座</li>\r\n                <li>1个PS/2鼠标插座</li>\r\n                <li>1个D-Sub插座</li>\r\n                <li>1个并列埠</li>\r\n                <li>1个串行埠</li>\r\n                <li>4个USB 2.0/1.1端口</li>\r\n                <li>1个RJ-45埠</li>\r\n                <li>3个音源接头(音源输入/音源输出/麦克风)</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">I/O控制器</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>内建iTE I/O 控制芯片</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">硬件监控</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>系统电压侦测</li>\r\n                <li>CPU/系统温度侦测</li>\r\n                <li>CPU/系统风扇转速侦测</li>\r\n                <li>CPU/系统智能风扇控制<br />\r\n                * 是否支持CPU/系统智能风扇控制功能会依不同的CPU/系统散热风扇而定。</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">BIOS</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>2个32 Mbit flash</li>\r\n                <li>使用经授权AMI EFI BIOS</li>\r\n                <li>支持DualBIOS&trade;</li>\r\n                <li>PnP 1.0a、DMI 2.0、SM BIOS 2.6、ACPI 2.0a</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">附加工具程序</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>支持@BIOS</li>\r\n                <li>支持Q-Flash</li>\r\n                <li>支持EasyTune<br />\r\n                * EasyTune可使用的功能会因不同主板而有所差异。</li>\r\n                <li>支持ON/OFF Charge</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">附赠软件</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>Norton Internet Security (OEM 版本)</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">操作系统</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>支持Microsoft&reg; Windows 8/7/Vista/XP</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">PCB规格</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol>\r\n                <li>Micro ATX规格；22.6公分x 17.4公分</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td align=\"left\" style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; width: 160px; padding-top: 7px\">备注</td>\r\n            <td style=\"padding-right: 7px; padding-left: 7px; padding-bottom: 7px; padding-top: 7px\">\r\n            <ol style=\"color: red; list-style-type: decimal\">\r\n                <li>因不同的芯片厂商对Linux有不同的支持情况,建议请由芯片厂商的网站或其他Linux网站下载驱动程序。</li>\r\n                <li>此产品不支持Win9X/ME/2000/XP SP1/SP2,因部分软/硬件厂商已不再对Win9X/ME/2000/XP SP1/SP2提供后续支持,</li>\r\n            </ol>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>','images/201302/thumb