          </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<div>\r\n<div>\r\n<table border=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td valign=\"top\"><img title=\"抗潮湿 &ndash; 高密度开纤布电路板\" alt=\"\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" style=\"border-top-width: 0px; border-left-width: 0px; border-bottom-width: 0px; border-right-width: 0px\" src=\"http://www.gigabyte.cn/fileupload/features/2/overview/2226.jpg\" /></td>\r\n            <td><span style=\"font-weight: bold; font-size: 15px; color: #1d6cfe\">防潮湿&ndash;防潮纤维电路板<br />\r\n            </span>没有什么比湿气更能伤害你的计算机! 世界上大部分地区的空气中都有很高的湿气，在湿气经年累月的侵蚀下，便容易造成计算机的伤害。技嘉第四代超耐久?经典版主板的设计，防潮纤维电路板让您的主板远离湿气的伤害，藉由使用最新的高密度开纤布材质电路板技术，减少湿气对电路板的侵蚀。而这种全新的电路板材质的导入，可以有效降低电路板中纤维束的厚度，相较于传统设计，新式高密度开纤布会减少水气渗入电路板中。如此降低因湿气所造成未知主板短路的可能。<br />\r\n            <br />\r\n            <img alt=\"\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" src=\"http://www.gigabyte.cn/FileUpload/Features/2/Photo/2173.jpg\" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\" style=\"border-top: #dedddd 1px solid\"><img title=\"Electrostatic Protection\" alt=\"\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" style=\"border-top-width: 0px; border-left-width: 0px; border-bottom-width: 0px; border-right-width: 0px\" src=\"http://www.gigabyte.cn/fileupload/features/2/overview/2389.jpg\" /></td>\r\n            <td style=\"border-top: #dedddd 1px solid\"><span style=\"font-weight: bold; font-size: 15px; color: #1d6cfe\">防雷击 &ndash; 防突波芯片<br />\r\n            </span>由于电击时容易让您家里发生莫名其妙的跳电及主板损坏，因此技嘉第四代超耐久?经典版主板可以降低您的计算机因为跳电所造成的致命伤害。技嘉第四代超耐久?经典版主板配备特殊的防突波IC芯片，可保护您的计算机及主板不受电击突波的伤害，确保您的计算机不会因为电流供应或突发性的电压不稳而受到伤害！<br />\r\n            <br />\r\n            <img alt=\"\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" src=\"http://www.gigabyte.cn/FileUpload/Features/2/Photo/2391.jpg\" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\" style=\"border-top: #dedddd 1px solid\"><img title=\"Power Failure Protection\" alt=\"\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" style=\"border-top-width: 0px; border-left-width: 0px; border-bottom-width: 0px; border-right-width: 0px\" src=\"http://www.gigabyte.cn/fileupload/features/2/overview/2390.jpg\" /></td>\r\n            <td style=\"border-top: #dedddd 1px solid\"><span style=\"font-weight: bold; font-size: 15px; color: #1d6cfe\">防静电 &ndash;防静电芯片<br />\r\n            </span>技嘉全系列第四代超耐久?经典版主板采用高质量IC芯片，具有比传统芯片更好的防静电效果。 技嘉第四代超耐久?经典版主板所使用的IC芯片提供比传统芯片高三倍的静电防护能力。这样的用料可以提供主板更佳的防护，通过这种优质组件的使用，降低计算机常见的静电威胁。br /&gt; <img alt=\"\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" src=\"http://www.gigabyte.cn/FileUpload/Features/2/Photo/2175.jpg\" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\" style=\"border-top: #dedddd 1px solid\"><img title=\"支持Intel 22奈米制程处理器\" alt=\"\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" style=\"border-top-width: 0px; border-left-width: 0px; border-bottom-width: 0px; border-right-width: 0px\" src=\"http://www.gigabyte.cn/fileupload/features/2/overview/2399.jpg\" /></td>\r\n            <td style=\"border-top: #dedddd 1px solid\"><span style=\"font-weight: bold; font-size: 15px; color: #1d6cfe\">支持Intel 22奈米制程处理器<br />\r\n            </span><br />\r\n            <img alt=\"\" align=\"left\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" src=\"http://www.gigabyte.cn/FileUpload/Features/2/Photo/2400.jpg\" /><br />\r\n            技嘉主板，支持Intel 22奈米制程处理器。</td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\" style=\"border-top: #dedddd 1px solid\"><img title=\"支持 PCI Express Gen.3 传输规格\" alt=\"\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" style=\"border-top-width: 0px; border-left-width: 0px; border-bottom-width: 0px; border-right-width: 0px\" src=\"http://www.gigabyte.cn/fileupload/features/2/overview/2338.jpg\" /></td>\r\n            <td style=\"border-top: #dedddd 1px solid\"><span style=\"font-weight: bold; font-size: 15px; color: #1d6cfe\">支持 PCI Express Gen.3 传输规格<br />\r\n            </span><br />\r\n            <img alt=\"\" align=\"left\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" src=\"http://www.gigabyte.cn/FileUpload/Features/2/Photo/2278.jpg\" /><br />\r\n            技嘉主板支持PCI Express 3.0传输技术，让新一代的 PCI Express 3.0 显卡带宽最大化，提供极致图形显示效能。 <br />\r\n            * PCIe Gen. 3功能依据处理器及显卡支持程度而有所差异。</td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\" style=\"border-top: #dedddd 1px solid\">&nbsp;</td>\r\n            <td style=\"border-top: #dedddd 1px solid\"><span style=\"font-weight: bold; font-size: 15px; color: #1d6cfe\">Intel 最新HD核心显卡2000/ 3000<br />\r\n            </span>\r\n            <p><strong>Intel<sup>?</sup> Quick Sync Video</strong><br />\r\n            Intel<sup>?</sup> Quick Sync Video技术可大幅加快多媒体数据编辑处理及分享的速度。</p>\r\n            <p><strong>Intel<sup>?</sup> InTru? 3D</strong><br />\r\n            最新第二代Intel<sup>?</sup> Core? 处理器支持 HDMI 1.4, 提供高达1080P分辨率的最极致的蓝光 3D立体影音体验。</p>\r\n            <p><strong>Intel<sup>?</sup> Advanced Vector Extensions (AVX)</strong><br />\r\n            Intel<sup>?</sup> Advanced Vector Extensions 技术可针对以浮点运算或向量运算为主的应用程序, 以最小的耗电提高最多的性能。 <br />\r\n            &nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\" style=\"border-top: #dedddd 1px solid\"><img title=\"支持On/Off Charge功能\" alt=\"\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" style=\"border-top-width: 0px; border-left-width: 0px; border-bottom-width: 0px; border-right-width: 0px\" src=\"http://www.gigabyte.cn/fileupload/features/2/overview/1668.jpg\" /></td>\r\n            <td style=\"border-top: #dedddd 1px solid\"><span style=\"font-weight: bold; font-size: 15px; color: #1d6cfe\">支持On/Off Charge功能<br />\r\n            </span>藉由技嘉独特USB 3倍电力供应设计，并搭配最新ON/OFF Charge技术，除了可提供iPhone手机，还包括iPad及iPod touch等目前广受欢迎的手持设备，不仅在计算机开机或关机都能随时提供充电，更支持快速充电，节省高达40%的充电时间，让您随时需要，即可随时使用。...<a>more</a> <br />\r\n            <font color=\"#ff0000\">*由于某些手机装置的规格限制，使用非On/Off Charge的USB端口时，在系统进入S4/S5状态前请先将手机连接于系统。手机快充情形，可能会依据不同机种而有所不同。</font> <a><img height=\"65\" alt=\"On/Off Charge Driver download\" width=\"240\" border=\"0\" _ks_lazy_height=\"65\" _ks_lazy_width=\"240\" src=\"http://www.gigabyte.cn/FileUpload/Features/2/Photo/1740.jpg\" /></a></td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\" style=\"border-top: #dedddd 1px solid\"><img title=\"Smart 6 - 更灵活的电脑管理方式\" alt=\"\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" style=\"border-top-width: 0px; border-left-width: 0px; border-bottom-width: 0px; border-right-width: 0px\" src=\"http://www.gigabyte.cn/fileupload/features/2/overview/1812.jpg\" /></td>\r\n            <td style=\"border-top: #dedddd 1px solid\"><span style=\"font-weight: bold; font-size: 15px; color: #1d6cfe\">智能6 - 更灵活的电脑管理方式<br />\r\n            </span><br />\r\n            <img alt=\"\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" src=\"http://www.gigabyte.cn/FileUpload/Features/2/Photo/1807.jpg\" /><br />\r\n            <table cellspacing=\"0\" cellpadding=\"0\" width=\"100%\" border=\"0\">\r\n                <tbody>\r\n                </tbody>\r\n            </table>\r\n            <table cellspacing=\"0\" cellpadding=\"0\" width=\"100%\" border=\"0\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td width=\"6%\"><img height=\"59\" alt=\"\" width=\"62\" _ks_lazy_height=\"59\" _ks_lazy_width=\"62\" src=\"http://www.gigabyte.cn/FileUpload/Features/2/Overview/88.jpg\" /></td>\r\n                        <td valign=\"top\" width=\"36%\">\r\n                        <p><strong>智能快速开机</strong><br />\r\n                        加快系统开机过程<br />\r\n                        &nbsp;</p>\r\n                        </td>\r\n                        <td width=\"6%\"><img height=\"59\" alt=\"\" width=\"62\" _ks_lazy_height=\"59\" _ks_lazy_width=\"62\" src=\"http://www.gigabyte.cn/FileUpload/Features/2/Overview/91.jpg\" /></td>\r\n                        <td valign=\"top\" width=\"52%\"><strong>智能双备份</strong><br />\r\n                        记录重要日期及密码的个人秘书</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td><img height=\"59\" alt=\"\" width=\"62\" _ks_lazy_height=\"59\" _ks_lazy_width=\"62\" src=\"http://www.gigabyte.cn/FileUpload/Features/2/Overview/89.jpg\" /></td>\r\n                        <td valign=\"top\"><strong>智能一键超频</strong><br />\r\n                        更快且不费力地达到处理器超频功能</td>\r\n                        <td><img height=\"59\" alt=\"\" width=\"62\" _ks_lazy_height=\"59\" _ks_lazy_width=\"62\" src=\"http://www.gigabyte.cn/FileUpload/Features/2/Overview/92.jpg\" /></td>\r\n                        <td valign=\"top\"><strong>智能监控</strong><br />\r\n                        监控、记录系统的活动状态</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td><img height=\"59\" alt=\"\" width=\"62\" _ks_lazy_height=\"59\" _ks_lazy_width=\"62\" src=\"http://www.gigabyte.cn/FileUpload/Features/2/Overview/90.jpg\" /></td>\r\n                        <td valign=\"top\"><strong>智能恢复</strong><br />\r\n                        系统可回复至指定的日期</td>\r\n                        <td><img height=\"59\" alt=\"\" width=\"62\" _ks_lazy_height=\"59\" _ks_lazy_width=\"62\" src=\"http://www.gigabyte.cn/FileUpload/Features/2/Overview/93.jpg\" /></td>\r\n                        <td valign=\"top\"><strong>智能时间锁</strong><br />\r\n                        Time 轻松管理使用电脑时间</td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            <font color=\"#ff0000\" size=\"2\">* 是否支持SMART QuickBoost功能，会因不同主板而有所差异。</font></td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\" style=\"border-top: #dedddd 1px solid\"><img title=\"支持ErP Lot 6\" alt=\"\" _ks_lazy_height=\"1\" _ks_lazy_width=\"1\" style=\"border-top-width: 0px; border-left-width: 0px; border-bottom-width: 0px; border-right-width: 0px\" src=\"http://www.gigabyte.cn/fileupload/features/2/overview/60.jpg\" /></td>\r\n            <td style=\"border-top: #dedddd 1px solid\"><span style=\"font-weight: bold; font-size: 15px; color: #1d6cfe\">支持ErP Lot 6<br />\r\n            </span>ErP全名为能源相关产品(Energy-related Products) ，属于欧盟环境保护法令的规范之一。随着目前电子产品的大量使用和普及，提升能源使用效益并促进环境永续发展是大家最关心的议题。使用技嘉一系列ErP 支持主板，将可以有效提升您使用的系统效能并节省更多的电力。</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<div style=\"padding-right: 10px; padding-left: 10px; padding-bottom: 10px; margin: 20px 10px 0px; padding-top: 10px; background-color: #f5f5f5\">\r\n<div>* 以上产品之规格、图片及其他信息仅供参考，如与实际产品有任何不相符之处，应以实际产品为准。技嘉科技保留在任何时间做出修改之权利。对任何因使用上述数据而引致之损失，技嘉科技概不承担任何责任。<br />\r\n* 本产品所标示之各项效能表现为各芯片厂商或各制定接口官方组织所提出的最大理论值，实际效能可能因规格及设备而有所不同。<br />\r\n* 本文中所使用之各项商标及企业识别图示，均为其合法所有人之财产。<br />\r\n* 基于PC基本架构，有部分内存空间须留作系统用途，故所侦测到之内存大小会比实际上较少。</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','images/201302/thumb_img/451_thumb_G_1361522802808.jpg','images/201302/goods_img/451_G_1361522802393.jpg','images/201302/source_img/451_G_1361522802005.jpg','1','','1','1','0','0','1361439023','100','0','0','0','0','0','0','1398368010','1','','0','0','0','0');
